/* eslint-disable class-methods-use-this */
import http from '../http-common';

class DataService {
  getAll() {
    return http.get('/sequelizeModel');
  }

  get(id) {
    return http.get(`/sequelizeModel/${id}`);
  }

  create(data) {
    return http.post('/sequelizeModel', data);
  }

  update(id, data) {
    return http.put(`/sequelizeModel/${id}`, data);
  }

  delete(id) {
    return http.delete(`/sequelizeModel/${id}`);
  }

  deleteAll() {
    return http.delete(`/sequelizeModel`);
  }

  findByTitle(title) {
    return http.get(`/sequelizeModel?title=${title}`);
  }
}

export default new DataService();
